import React from 'react';
import './CategoriesGrid.css';

const categories = [
  'Technology',
  'Health',
  'Finance',
  'Education',
  'Travel',
  'Food',
  'Sports',
  'Entertainment'
];

const CategoriesGrid = () => {
  return (
    <div className="categories-container">
      {categories.map((category, index) => (
        <div key={index} className="category-item">
          {category}
        </div>
      ))}
    </div>
  );
};

export default CategoriesGrid;
